import React, { useState, useEffect, useMemo } from 'react';
import {
	Box,
	Scene,
	Sphere,
	Text,
	Plane,
	Sky,
	Cylinder,
	Entity,
	MarkerCamera,
	Camera,
	Cursor,
	Marker,
} from 'react-aframe-ar';

const SceneWithAR = ({ images }) => {
	return (
		<Scene
			vr-mode-ui='enabled;false;'
			renderer='antialias: true;physicallyCorrectLights: true;logarithmicDepthBuffer:true;'
		>
			<Box position='-1 0.5 -13' rotation='0 45 0' color='#4CC3D9' shadow />
			<Sphere position='0 1.25 -15' radius='1.25' color='#EF2D5E' shadow />
			<Cylinder position='1 0.75 -13' radius='0.5' height='1.5' color='#FFC65D' shadow />
			<Plane
				position='0 0 -14'
				rotation='-90 0 0'
				width='4'
				height='4'
				color='#7BC8A4'
				shadow
			/>

		</Scene>
	);
};

export default SceneWithAR;
